        protected override async void OnInitialized()
        {
            var productvariations = await AbstractTheatreService.GetProductVariations();
            var products = await AbstractTheatreService.GetProducts();
            var abstractimages = await AbstractTheatreService.GetImages();
            var galleryimages = await AbstractTheatreService.GetGalleryImages();
            var galleryvideos = await AbstractTheatreService.GetGalleryVideos();
            var profiles = await AbstractTheatreService.GetProfiles();
            int profileid = await AbstractTheatreService.GetProfileID(Security.User.Id);

            
            List<ProductVariation> variations = productvariations.ToList();

            CustomPackages = variations.Where(x => x.ProfileID == profileid).ToList();



            Profile = profiles.First(x => x.ProfileId == ID);

            Products = products.Where(x => x.ProfileId == Profile.ProfileId).ToList();

            List<GalleryImage> pics = galleryimages.Where(x => x.ProfileID == Profile.ProfileId).ToList();

            List<GalleryVideo> vids = galleryvideos.Where(x => x.ProfileID == Profile.ProfileId).ToList();


            vids = galleryvideos.Where(x => x.ProfileID == Profile.ProfileId).ToList();
           

            pics = pics.Where(x => x.IsProfilePic == true).ToList();
            vids = vids.Where(x => x.IsProfileVideo == true).ToList();

            if(pics.Count > 0)
            {
                int i = pics.First().ImageId;
                AbstractImage ProfilePicture = await AbstractTheatreService.GetImageByImageId(i);
                Imgdata = BytetoImageBase64(ProfilePicture.Image1);

            }
            else
            {
                Imgdata = "/images/Default_Profile_Pic.png";
            }


            GalleryVideo ProfileVideo = await AbstractTheatreService.GetGalleryVideoByGalleryVideoId(vids.First().ID);
            
            
            VideoLink = EmbedVideo(YouTubeAPI.ExtractVideoId(ProfileVideo.VideoLink));



              foreach (var product in Products)
            {
                List<ProductVariation> productVariations = productvariations.Where(x => x.ProductId == product.ProductId).ToList();

                try
                {

                    if (productVariations.Count() > 0)
                    {
                        ProductVariations.Add(productVariations.FirstOrDefault(x => x.ProductId == product.ProductId));

                    }
                }
                catch (Exception ex)
                {

                }
            }

              foreach(var x in ProductVariations)
            {
                PageProduct product = new PageProduct(x);
                product.Imgdata = await FindThumbnail(product.ProductVariationId);
                PageProducts.Add(product);
            }

              foreach(var x in CustomPackages)
            {
                PageProduct product = new PageProduct(x);
                product.Imgdata = await FindThumbnail(product.ProductVariationId);
                PageCustomPackages.Add(product);
            }
          
        }

